// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./SyndicateClosedEndFundLogic.sol";
import "./interfaces/ISyndicateClosedEndFundDepositLogicV0.sol";

/// @author Syndicate Inc.
/// @notice Handle member deposit accounting and ERC20 transfers
contract SyndicateClosedEndFundDepositLogicV0 is
    ISyndicateClosedEndFundDepositLogicV0,
    SyndicateClosedEndFundLogic
{
    using SafeERC20 for IERC20;

    // Storage------------------------------------------------------------------

    /// @notice Used to initialize the Syndicate contract.
    constructor(address owner, address storeAddress)
        SyndicateClosedEndFundLogic(owner, storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice A manager updates the minimum deposit amount per wallet address.
    event DepositMemberMinUpdated(
        address indexed syndicateAddress,
        uint256 depositMemberMin
    );

    /// @notice A manager updates the maximum deposit amount per wallet address.
    event DepositMemberMaxUpdated(
        address indexed syndicateAddress,
        uint256 depositMemberMax
    );

    /// @notice A manager updates the maximum total deposit amount.
    event DepositTotalMaxUpdated(
        address indexed syndicateAddress,
        uint256 depositTotalMax
    );

    /// @notice A member deposits into a syndicate.
    /// @dev This is the only way to search for a member's Syndicates. The
    /// Syndicates on chain rely on a mapping, so they are not iterable.
    /// Instead, it's necessary to search through an indexed memberAddress
    /// off-chain to get a list of a member's Syndicates for screens such as the
    /// My Syndicates screen.
    /// @dev This must be reconciled with `DepositRemoved` events to get
    /// a list of all Syndicates for which a member has a nonzero deposit.
    event DepositAdded(
        address indexed syndicateAddress,
        address indexed memberAddress,
        uint256 amount
    );

    /// @notice A member withdraws a deposit or a manager rejects a member's deposit.
    /// @dev `actor` is used to differentiate between who is triggering the
    /// event emission. Current options are "member" and "manager", but more
    /// may be introduced (e.g. "integration").
    event DepositRemoved(
        address indexed syndicateAddress,
        address indexed memberAddress,
        uint256 amount,
        string actor
    );

    /// @notice A manager overrides a member's balance with a new value.
    /// Applicable to `modifiable` Syndicates only.
    /// @dev The balance emitted is the new value, not the change in value.
    event DepositOverridden(
        address indexed syndicateAddress,
        address indexed memberAddress,
        uint256 value
    );

    // Functions----------------------------------------------------------------

    /// @notice Set the minimum deposit per wallet address. This is the minimum
    /// that a single member can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositMemberMin The minimum deposit amount per member. Must not
    /// exceed the current `depositMemberMax`.
    function managerSetDepositMemberMin(
        address syndicateAddress,
        uint256 depositMemberMin
    ) public override onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositMemberMin <= store.depositMemberMax(syndicateAddress),
            "MIN_MBR_DEP>MAX_MBR_DEP"
        );

        store.setDepositMemberMin(syndicateAddress, depositMemberMin);

        emit DepositMemberMinUpdated(syndicateAddress, depositMemberMin);
    }

    /// @notice Set the maximum deposit per wallet address. This is the maximum
    /// that a single member can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositMemberMax The maximum deposit amount per user. Must be at
    /// least the current `depositMemberMin`, and cannot exceed the current
    /// `depositTotalMax`.
    function managerSetDepositMemberMax(
        address syndicateAddress,
        uint256 depositMemberMax
    ) public override onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositMemberMax >= store.depositMemberMin(syndicateAddress),
            "MAX_MBR_DEP<MIN_MBR_DEP"
        );
        require(
            depositMemberMax <= store.depositTotalMax(syndicateAddress),
            "MAX_MBR_DEP>MAX_TOT_DEP"
        );

        store.setDepositMemberMax(syndicateAddress, depositMemberMax);

        emit DepositMemberMaxUpdated(syndicateAddress, depositMemberMax);
    }

    /// @notice Set the maximum total deposit amount. This is the maximum
    /// that all members combined can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositTotalMax The maximum total number of deposits. Must be
    /// at least the current `depositMemberMax`.
    /// @notice `depositTotalMax` is not required to be at least `depositTotal`.
    /// Setting `depositTotalMax` to be less than `depositTotal` can be thought
    /// of as a simple way to cut off deposits if the Syndicate has grown too
    /// large.
    function managerSetDepositTotalMax(
        address syndicateAddress,
        uint256 depositTotalMax
    ) public override onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositTotalMax >= store.depositMemberMax(syndicateAddress),
            "MAX_TOT_DEP<MAX_MBR_DEP"
        );

        store.setDepositTotalMax(syndicateAddress, depositTotalMax);

        emit DepositTotalMaxUpdated(syndicateAddress, depositTotalMax);
    }

    /// @notice Used by a member to make a deposit to an open Syndicate.
    /// @param syndicateAddress The Syndicate that a member is depositing to
    /// @param amount The amount to be transferred from the member's wallet,
    /// valued in the Syndicate's deposit ERC20 token
    /// @notice If a manager is issuing a Syndicate under SEC Rule 506(b) of
    /// Regulation D, a manager should only add a member's address(es) to the
    /// allowlist if the member attests that they are an accredited investor.
    /// This is also highlighted in the web interface, but it is not a
    /// requirement of the smart contract since not all Syndicates are
    /// securities, nor are all Syndicates that are securities necessarily
    /// 506(b) offerings (they could be 506(c) offerings for example).
    /// @notice Under Rule 506(b), up to 35 non-accredited investors can invest
    /// in a private placement. These non-accredited investors must have
    /// sufficient knowledge and experience, which is difficult to verify in a
    /// decentralized context. As a result, we leave it up to the Syndicate
    /// manager to track their own list of up to 35 non-accredited investors and
    /// add them to the allowlist. The Syndicate manager must provide
    /// disclosures to non-accredited investors that comply with Regulation A
    /// offerings, give non-accredited investors financial statement
    /// information specified in Rule 506, and be available to answer questions
    /// from potential members who are non-accredited investors. This
    /// responsibility rests with the Syndicate manager. See
    /// https://www.sec.gov/smallbusiness/exemptofferings/rule506b
    /// @notice Nothing in this documentation should be considered legal
    /// advice. If you are seeking any clarification, please email us at
    /// hello[at]syndicateprotocol.org.
    /// @dev The member's deposit is associated with the address of `msg.
    /// sender`. The member can later transfer their deposit (and therefore
    /// their ownership stake) to another address if the manager has set the
    /// Syndicate as `transferable`.
    function memberDeposit(address syndicateAddress, uint256 amount)
        public
        override
        nonReentrant()
        onlyNotManager(syndicateAddress)
        onlyBeforeDateClose(syndicateAddress)
        enforceAllowlist(syndicateAddress, msg.sender)
    {
        _deposit(syndicateAddress, msg.sender, amount);
    }

    /// @notice Used by a member to withdraw a deposit from an open Syndicate
    /// or a distribution from a closed Syndicate.
    /// @param syndicateAddress The Syndicate that a member will withdraw from.
    /// @param amount The amount of tokens to be withdrawn which are of the same
    /// ERC20 as the deposit token.
    /// @notice Withdrawal options are different depending on the Syndicate's
    /// progression through its life cycle. When the Syndicate is open, a member
    /// can make a withdrawal in the deposit ERC20 token (essentially refunding
    /// their deposit).
    /// @dev Withdrawals are processed before any fees that any ERC20 token may
    /// assess. The amount that all users receive may be lower if an ERC20
    /// token takes a fee upon a transfer.
    /// @dev memberWithdraw() follows the Checks-Effects-Interactions pattern
    function memberWithdraw(address syndicateAddress, uint256 amount)
        public
        override
        onlyNotManager(syndicateAddress)
        onlyOpen(syndicateAddress)
    {
        _withdraw(syndicateAddress, msg.sender, amount, false);
    }

    /// @notice Used by a manager to reject a member's deposit
    /// @param syndicateAddress The Syndicate that the member deposited in
    /// @param memberAddresses The members whose WHOLE contribution is being
    /// returned
    function managerRejectDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses
    ) public override onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        for (uint256 i = 0; i < memberAddresses.length; i++) {
            uint256 returnAmount = store.depositMember(
                syndicateAddress,
                memberAddresses[i]
            );

            _withdraw(syndicateAddress, memberAddresses[i], returnAmount, true);
        }
    }

    /// @notice Used by a manager to manually adjust the deposit amount for
    /// multiple member address (e.g. in response to off-chain transactions).
    /// This function **does not** enforce constraints on `depositMemberMin`,
    /// `depositMemberMax`, `depositTotalMax`, or `numMembersMax`. However, it
    /// **does** update bookkeeping of `depositTotal` and `numMembersCurrent`.
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddresses The addresses of the member whose deposit is
    /// being adjusted
    /// @param amounts The new deposit amount to be set for the corresponding
    /// index in the memberAddresses array. These arrays must be the same
    /// length. Note that the new amount completely replaces the prior deposit
    /// amount for the member. It does not add or subtract from it.
    /// @notice This function can only be called if the Syndicate is modifiable.
    /// The modifiable boolean is set by the manager on creation and cannot be
    /// changed after the Syndicate is created.
    /// @notice This function can only be called before distributions have been
    /// enabled (though the Syndicate may be closed to deposits). If
    /// distributions have already been enabled, then changing deposit amounts
    /// could affect the ownership share of unclaimed distributions and create
    /// significant problems for other members.
    function managerSetDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses,
        uint256[] calldata amounts
    )
        public
        override
        onlyManager(syndicateAddress)
        onlyOpen(syndicateAddress)
        onlyModifiable(syndicateAddress)
    {
        require(
            memberAddresses.length == amounts.length,
            "ARRAY_LENGTHS_DIFFER"
        );

        for (uint256 i = 0; i < memberAddresses.length; i++) {
            _setDeposit(syndicateAddress, memberAddresses[i], amounts[i]);
        }
    }

    // Internal functions-------------------------------------------------------

    /// @notice Process a deposit to a Syndicate.
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member who is depositing
    /// @param amount The amount that `memberAddress` is depositing, in the
    /// token defined by the Syndicate's depositERC20Address
    /// @dev This function is high risk. If the `.transferFrom` line can be
    /// redirected elsewhere, deposits could be stolen. In addition, if the
    /// deposits are not properly tracked, a user could withdraw more than their
    /// allocated share of the distributions.
    function _deposit(
        address syndicateAddress,
        address memberAddress,
        uint256 amount
    ) internal onlyLogicContractAllowedGuard() {
        // Without this line, a member could spam deposits of 0. It is
        // additionally necessary to protect `_processDeposit` from
        // incrementing `numMembersCurrent` when a member with a deposit of 0
        // deposits 0.
        require(amount > 0, "DEP<=0");

        // Check that this deposit will not surpass the fund's depositTotalMax
        require(
            store.depositTotalMax(syndicateAddress) >=
                store.depositTotal(syndicateAddress) + amount,
            "DEP>MAX_TOT_DEP"
        );

        // If this is the member's first deposit to the Syndicate, check that
        // the Syndicate has not already received deposits from its maximum
        // number of members
        if (store.depositMember(syndicateAddress, memberAddress) == 0) {
            require(
                store.numMembersCurrent(syndicateAddress) <
                    store.numMembersMax(syndicateAddress),
                "MAX_MBRS_REACHED"
            );
        }

        // Check that the member's balance will not be below `depositMemberMin`
        // AFTER the execution of this deposit
        require(
            store.depositMemberMin(syndicateAddress) <=
                store.depositMember(syndicateAddress, memberAddress) + amount,
            "0<BAL<MIN_MBR_DEP"
        );

        // Check that this deposit will not cause the member to surpass
        // `depositMemberMax`
        require(
            store.depositMemberMax(syndicateAddress) >=
                store.depositMember(syndicateAddress, memberAddress) + amount,
            "BAL>MAX_MBR_DEP"
        );

        // Cannot follow the Checks-Effects-Interactions-Pattern to prevent
        // reentrancy attacks because we do not know the balance of the token
        // until after the transfer (to handle tokens that take a fee).
        // Instead, we use a nonReentrant() modifier via ReentrancyGuard on
        // memberDeposit()
        IERC20 depositERC20 = IERC20(
            store.depositERC20Address(syndicateAddress)
        );

        depositERC20.transferFrom(
            memberAddress,
            store.managerCurrent(syndicateAddress),
            amount
        );

        // If this is a first-time depositor, increment the number of members
        if (store.depositMember(syndicateAddress, memberAddress) == 0) {
            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) + 1
            );
        }

        store.setDepositMember(
            syndicateAddress,
            memberAddress,
            store.depositMember(syndicateAddress, memberAddress) + amount
        );

        store.setDepositTotal(
            syndicateAddress,
            store.depositTotal(syndicateAddress) + amount
        );

        emit DepositAdded(syndicateAddress, memberAddress, amount);
    }

    /// @notice Process a withdrawal from a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member who is depositing
    /// @param amount The amount that `memberAddress` is depositing, in the
    /// token defined by the Syndicate's depositERC20Address
    /// @param calledByManager If this method is called by a manager
    function _withdraw(
        address syndicateAddress,
        address memberAddress,
        uint256 amount,
        bool calledByManager
    ) internal onlyLogicContractAllowedGuard() {
        // Without this line, a member could spam withdrawals of 0. It is
        // additionally necessary to protect `_processWithdrawalOpen` from
        // decrementing `numMembersCurrent` when a member with a deposit of 0
        // withdraws 0.
        require(amount > 0, "WTH<=0");

        // HIGH RISK: Without this line, a member could withdraw more than
        // they put into the fund.
        require(
            amount <= store.depositMember(syndicateAddress, memberAddress),
            "WTH>BAL"
        );

        // HIGH RISK: Without this line, a member could withdraw below
        // the minDepositLP (withdrawal of the entire balance is allowed).
        require(
            store.depositMember(syndicateAddress, memberAddress) - amount >=
                store.depositMemberMin(syndicateAddress) ||
                store.depositMember(syndicateAddress, memberAddress) - amount ==
                0,
            "0<BAL<MIN_MBR_DEP"
        );

        store.setDepositMember(
            syndicateAddress,
            memberAddress,
            store.depositMember(syndicateAddress, memberAddress) - amount
        );

        store.setDepositTotal(
            syndicateAddress,
            store.depositTotal(syndicateAddress) - amount
        );

        // if member withdraws all their deposits, decrement number of members
        if (store.depositMember(syndicateAddress, memberAddress) == 0) {
            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) - 1
            );
        }

        // Decreasing the amounts before calling transferFrom is *critical* for
        // preventing re-entrancy attacks. See SYN-143 for more details.
        // Now that we've decreased the amounts, we can allow the transferFrom
        // to proceed. If the transferFrom fails, the entire function will
        // revert. transferFrom ensures that a non-reverting call was
        // successful and that a revert indicates failure, which removes the
        // need for a require statement around the ERC-20 call.
        // See https://ethereum.stackexchange.com/questions/28985/does-revert-require-revert-changes-made-to-other-contracts
        // Also see https://docs.soliditylang.org/en/v0.7.6/control-structures.html

        IERC20 withdrawalERC20 = IERC20(
            store.depositERC20Address(syndicateAddress)
        );

        // HIGH RISK: If we did not use `memberAddress`, this could be used to
        // redirect funds from users other than the wallet holder (or smart
        // contract owner, if a DAO is making the withdrawal).
        withdrawalERC20.transferFrom(
            store.managerCurrent(syndicateAddress),
            memberAddress,
            amount
        );

        string memory actor = calledByManager ? "manager" : "member";

        emit DepositRemoved(syndicateAddress, memberAddress, amount, actor);
    }

    /// @notice Set the deposit amount for a single member.
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member
    /// @param amount The new deposit amount to set for the member.
    /// @dev This function makes setting a large number of deposit amounts
    /// slightly more gas efficient by calling each of the parent function's.
    /// modifiers only once. Importantly, that means the parent is responsible
    /// for enforcing these constraints and CANNOT rely on this helper function
    /// to do so.
    function _setDeposit(
        address syndicateAddress,
        address memberAddress,
        uint256 amount
    ) internal {
        // A manager cannot make deposits to their own Syndicate, as they would
        // receive an ownership stake without transferring capital
        require(msg.sender != memberAddress, "SDR_NOT_MBR");

        // Ensure the new `depositTotal` does not exceed bookkeeping
        // capacities, in order to prevent reversion of other operations such
        // as `getDistributionUnclaimedMember()` later.
        require(
            amount <
                type(uint256).max -
                    store.depositTotal(syndicateAddress) -
                    store.depositMember(syndicateAddress, memberAddress),
            "DEP>=UINT256"
        );

        // Safeguard against a successful call to this function without any
        // change of state, which could increase the likelihood of manager
        // error (e.g. a manager thinking they have successfully removed all
        // funds for a member when they in fact used the wrong address).
        if (amount == 0) {
            require(
                store.depositMember(syndicateAddress, memberAddress) != 0,
                "NO_CHANGE"
            );
        }

        // Store the previous deposit amount for bookkeeping
        uint256 oldDepositMember = store.depositMember(
            syndicateAddress,
            memberAddress
        );

        // Set the member's new balance
        store.setDepositMember(syndicateAddress, memberAddress, amount);

        // Check if the old or new balance is greater before subtracting to
        // avoid overflows
        uint256 depositDiff;

        // If the modification effectively DECREASES the member's deposit:
        if (oldDepositMember > amount) {
            depositDiff = oldDepositMember - amount;
            // Decrease the Syndicate's depositTotal
            store.setDepositTotal(
                syndicateAddress,
                store.depositTotal(syndicateAddress) - depositDiff
            );
            // If the member's new deposit is 0, decrement numMembersCurrent
            if (amount == 0) {
                store.setNumMembersCurrent(
                    syndicateAddress,
                    store.numMembersCurrent(syndicateAddress) - 1
                );
            }
        }
        // If the modification effectively INCREASES the member's deposit:
        else if (oldDepositMember < amount) {
            depositDiff = amount - oldDepositMember;
            // Increase the Syndicate's depositTotal
            store.setDepositTotal(
                syndicateAddress,
                store.depositTotal(syndicateAddress) + depositDiff
            );
            // If the member's prior deposit was 0, increment numMembersCurrent
            if (oldDepositMember == 0) {
                store.setNumMembersCurrent(
                    syndicateAddress,
                    store.numMembersCurrent(syndicateAddress) + 1
                );
                // Ensure `numMembersCurrent <= numMembersMax` at all times
                if (
                    store.numMembersCurrent(syndicateAddress) >
                    store.numMembersMax(syndicateAddress)
                ) {
                    store.setNumMembersMax(
                        syndicateAddress,
                        store.numMembersCurrent(syndicateAddress)
                    );
                }
            }
        }

        emit DepositOverridden(syndicateAddress, memberAddress, amount);
    }
}

